import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import 'primereact/resources/themes/lara-light-indigo/theme.css';  // Theme của PrimeReact
import 'primereact/resources/primereact.min.css';                   // CSS của PrimeReact
import 'primeicons/primeicons.css';                                 // Icon của PrimeReact
import './App.css';                                                 // CSS tùy chỉnh

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
